function setupFields() {
    this.removeFields()
    var fieldSize = 40;
    for(var i=0; i < 16; i++) {
        for(var j=0; j < 16; j++) {
            var field = Morph.makeRectangle(0,0,fieldSize,fieldSize);
            field.isField = true;
            field.setFill(Color.white)
            field.setPosition(pt(i * fieldSize,j * fieldSize))
            field.disableGrabbing(true)
            field.disableDropping(true)
            this.addMorph(field)
        }
    }


}

